import { Component } from '@angular/core';
import { RouterModule } from '@angular/router';

@Component({
  selector: 'app-root',
  imports: [
    RouterModule
  ],
  template: `
  <main>
    <div>Harlo</div>
    <img class="header" src="/assets/trolltunga.png" alt="ono where image" aria-hidden="true">
  </main>  
  `,
//  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'portfolio';
}
